    false,nt"url": null,nt"notes": "This data set contains the 2001-era and
    2006-era classifications of U.S. Great Lakes, zone 65 and can be used to analyze
    change. This imagery was collected as part of the Multi-Resolution Land Characteristics
    program in a multi-agency effort to provide baseline multi-scale environmental characteristics
    and to monitor environmental change. This data set utilized 41 full or partial Landsat
    5 and 7 scenes which were analyzed according to the Coastal Change Analysis Program
    (C-CAP) protocol to determine land cover.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
